import React, {Component} from "react";
import "./main.css";
import hand_right from "./img/hand-right.png";

class Main extends Component{
    render(){
        return(
            <div className="main">
                <div className="block_1">
                    <div className="descr">
                        <h3>Ваш надежный партнер в безопасности</h3>
                        <span>
                            Мы специализируемся на обеспечении безопасности в области робототехники. 
                            Наша команда разрабатывает интегрированные решения, которые помогают предотвратить 
                            риски и обеспечить безопасность во всех аспектах работы с роботехническими комплексами.
                        </span>
                    </div>
                    <img src={hand_right}/>
                </div>
            </div>
        )
    }
}

export default Main
